import React from 'react';

const Table = ({ item }) => {

    return (
      <tr key={item.id} className="table">
        <td>{item.first_name}</td>
        <td>{item.last_name}</td>
        <td>{item.email}</td>
        <td>{item.phone}</td></tr>
    );
  };

export default Table
